import UnitsBlock from "./elements/UnitsBlock";


export default function Units() {
    return (
        <section className='section units py-16'>
            <div className="container mx-auto">
                <h2 className="text-yellow text-center text-5xl mb-8">
                    Герои
                </h2>
                <div className="slider">
                    <UnitsBlock />
                </div>
            </div>
        </section>
    )
}
